import React, { Component } from "react";

export default class About extends Component {
  state = {
    userName: "mahmoud",
    lastName: "kadry",
    job: "idk",
    age: "26",
    productList: [
      { pName: "xaiomi", pPrice: 3000, pCat: "mobile" },
      { pName: "apple", pPrice: 35000, pCat: "mobile" },
      { pName: "apple", pPrice: 35000, pCat: "mobile" },
    ],
  };
  render() {
    return (
      <>
        <h2>hello</h2>
        <p>
          {this.state.userName}
          {this.state.lastName}
        </p>
        <p>my job is :{this.state.job}</p>
        <p>my age is : {this.state.age}</p>
      </>
    );
  }
}
